import React from 'react';
import PropTypes from 'prop-types';
import './FeaturedNews.scss';

FeaturedNews.propTypes = {
  itemList: PropTypes.array,
  selectedItem: PropTypes.func,
};

FeaturedNews.defaultProps = {
  itemList: [],
  selectedItem: null,
};

function FeaturedNews(props) {
  return (
    <div className="FeaturedNews">
      <h3 className="TitleFeaturedNews">Tin tức nổi bật</h3>
      <ul className="ContentFeaturedNews">
        <li>
          <div className="CardItem">
            <div className="ImageItem">
              <img
                className="Image"
                src={require("../../assets/images/camera.jpg").default}
              />
            </div>
            <div className="ContentItem">
              <h4 className="TitleItem">
                Panasonic ra mắt bộ 3 máy ảnh Compact mới Panasonic ra mắt bộ 3
                máy ảnh Compact mới Panasonic ra mắt bộ 3 máy ảnh Compact mới
              </h4>
            </div>
          </div>
        </li>
        <li>
          <div className="CardItem">
            <div className="ImageItem">
              <img
                className="Image"
                src={require("../../assets/images/camera.jpg").default}
              />
            </div>
            <div className="ContentItem">
              <h4 className="TitleItem">
                Panasonic ra mắt bộ 3 máy ảnh Compact mới
              </h4>
            </div>
          </div>
        </li>
      </ul>
    </div>
  );
}

export default FeaturedNews;
